import styled from "styled-components";

export const HeaderPlayerWrapper = styled.div`
  h3 {
    height: 23px;
    margin-bottom: 20px;
    border-bottom: 1px solid #ccc;
    font-size: 12px;
    font-weight: 700;
    color: #333;
  }
`;
